import React from 'react'
var tf = require('@tensorflow/tfjs')

let model = null

try{
	model = tf.loadLayersModel('modelJS/model.json')
	console.log(model == null);
}
catch(e){
	console.log(e);
}
const Main = () => {

	if (model == null)
		console.log('model loaded')
	return null
}

export default Main;
